// import './style.css';
import WhiteBox from '../../components/whitebox/whitebox';
import GameBox from '../../components/gamebox/gamebox';

const games = [
  {
    id: 1,
    team1: "SIS",
    team2: "KIS",
    score1: 2,
    score2: 0,
    livetext: "LIVE"
  }
]

function Content() {
  <div>
    {games.forEach(game => {
      console.log(game)
      return (
        <GameBox id={game.id} team1={game.team1} team2={game.team2} score1={game.score1} score2={game.score2} livetext={game.livetext} />
      );
    })
    }
  </div>
}

function Home() {
  return (
    <div>
      {/* <WhiteBox title="Fixtures" content={<Content />} /> */}
      <GameBox id={games[0].id} team1={games[0].team1} team2={games[0].team2} score1={games[0].score1} score2={games[0].score2} livetext={games[0].livetext} />
    </div>
  );
}

export default Home;
